pragma solidity ^0.6.12;

contract MyContract {
    string public standard;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public sellprice;
    uint256 public buyprice;
    mapping (address => uint256) public balanceof;

    constructor() public payable {
        if(msg.value == 0){
            if(sha3(abi.encodePacked(0))+((31+(bytes(standard).length/2))/32) <= sha3(abi.encodePacked(0))){
                totalsupply = 0x3b9aca00;
                balanceof[address(this)] = 0x3b9aca00;
                name = "";
            }
        }

        standard = "";
    }

    function buy() public payable {
        require(buyprice != 0 && balanceof[address(this)] >= msg.value / buyprice);
        balanceof[msg.sender] += msg.value / buyprice;
        balanceof[address(this)] -= msg.value / buyprice;
    }

    function sell(uint256 amount) public {
        require(balanceof[msg.sender] >= amount);
        balanceof[address(this)] += amount;
        balanceof[msg.sender] -= amount;
        msg.sender.call{value: amount * sellprice}("");
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceof[msg.sender] >= _value && balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }
}
